function App() {
  return (
  <div className="App">
    <div className="box">
      <div className="columns is-mobile">
        <div className="column is-8 is-offset-2"><Search></Search></div>
      </div>
      <div className="columns is-mobile">
        <div className="column is-small is-8 is-offset-2"><Icon></Icon></div>
      </div>
    </div>      
  </div>
  );
}

export default App;
